import React from "react";
import { Link } from "react-router-dom";
import "../styles/login.css"; // Make sure to create this CSS file for styling

const Login = () => {
  return (
    <div className="login-container">
      <h2>Select Your Role</h2>
      <div className="role-options">
        <Link to="/register/doctor" className="role-card doctor">
          <h3>Register as Doctor</h3>
        </Link>
        <Link to="/register/patient" className="role-card patient">
          <h3>Register as Patient</h3>
        </Link>
        <Link to="/register/pharmacy" className="role-card pharmacy">
          <h3>Register as Pharmacy</h3>
        </Link>
      </div>
    </div>
  );
};

export default Login;
